We start by defining a coordinate system for our game (src/game/coords.rs). use super::Prng; use heapless::FnvIndexSet; /// A single point on the grid.
#[derive(Debug, Copy, Clone, Eq, PartialEq, Hash)]
pub struct Coords { // Signed ints to allow negative values (handy when checking if we have gone // off the top or left of the grid) pub row: i8, pub col: i8,
} impl Coords { /// Get random coordinates within a grid. `exclude` is an optional set of /// coordinates which should be excluded from the output. pub fn random(rng: &mut Prng, exclude: Option<&FnvIndexSet<Coords, 32>>) -> Self { let mut coords = Coords { row: ((rng.random_u32() as usize) % 5) as i8, col: ((rng.random_u32() as usize) % 5) as i8, }; while exclude.is_some_and(|exc| exc.contains(&coords)) { coords = Coords { row: ((rng.random_u32() as usize) % 5) as i8, col: ((rng.random_u32() as usize) % 5) as i8, } } coords } /// Whether the point is outside the bounds of the grid. pub fn is_out_of_bounds(&self) -> bool { self.row < 0 || self.row >= 5 || self.col < 0 || self.col >= 5 }
} We use a Coords struct to refer to a position on the grid. Because Coords only contains two integers, we tell the compiler to derive an implementation of the Copy trait for it, so we can pass around Coords structs without having to worry about ownership.

116.body:
We define an associated function, Coords::random, which will give us a random position on the grid. We will use this later to determine where to place the snake's food. To generate random coordinates, we need a source of random numbers. The nRF52833 has a hardware random number generator (HWRNG) peripheral, documented at section 6.19 of the nRF52833 spec . The HAL gives us a simple interface to the HWRNG via the microbit::hal::rng::Rng struct. The HWRNG may not be fast enough for a game; it is also convenient for testing to be able to replicate the sequence of random numbers produced by the generator between runs, which is impossible for the HWRNG by design. We thus also define a pseudo-random number generator (PRNG). The PRNG uses an xorshift algorithm to generate pseudo-random u32 values. The algorithm is basic and not cryptographically secure, but it is efficient, easy to implement and good enough for our humble snake game. Our Prng struct requires an initial seed value, which we do get from the RNG peripheral. All of this makes up src/game/rng.rs. use crate::Rng; /// A basic pseudo-random number generator.
pub struct Prng { value: u32,
} impl Prng { pub fn seeded(rng: &mut Rng) -> Self { Self::new(rng.random_u32()) } pub fn new(seed: u32) -> Self { Self { value: seed } } /// Basic xorshift PRNG function: see <https://en.wikipedia.org/wiki/Xorshift> fn xorshift32(mut input: u32) -> u32 { input ^= input << 13; input ^= input >> 17; input ^= input << 5; input } /// Return a pseudo-random u32. pub fn random_u32(&mut self) -> u32 { self.value = Self::xorshift32(self.value); self.value }
}

