First, we will initialise the buttons (src/controls/init.rs). use super::{Buttons, GPIO}; use cortex_m::interrupt::free as interrupt_free;
use microbit::{ hal::{ gpio::{Floating, Input, Pin}, gpiote::{Gpiote, GpioteChannel}, }, pac,
}; /// Initialise the buttons and enable interrupts.
pub fn init_buttons(board_gpiote: pac::GPIOTE, board_buttons: Buttons) { let gpiote = Gpiote::new(board_gpiote); fn init_channel(channel: &GpioteChannel<'_>, button: &Pin<Input<Floating>>) { channel.input_pin(button).hi_to_lo().enable_interrupt(); channel.reset_events(); } let channel0 = gpiote.channel0(); init_channel(&channel0, &board_buttons.button_a.degrade()); let channel1 = gpiote.channel1(); init_channel(&channel1, &board_buttons.button_b.degrade()); interrupt_free(move |cs| { *GPIO.borrow(cs).borrow_mut() = Some(gpiote); unsafe { pac::NVIC::unmask(pac::Interrupt::GPIOTE); } pac::NVIC::unpend(pac::Interrupt::GPIOTE); });
} The GPIOTE peripheral on the nRF52 has 8 "channels", each of which can be connected to a GPIO pin and configured to respond to certain events, including rising edge (transition from low to high signal) and falling edge (high to low signal). A button is a GPIO pin which has high signal when not pressed and low signal otherwise. Therefore, a button press is a falling edge. Note the awkward use of the function init_channel() in initialization to avoid copy-pasting the button initialization code. The types that the various embedded crates for the MB2 have been hiding from you are sometimes a bit scary. I would encourage you to explore the type structure of the HAL and PAC crates at some point, as it is a bit odd and takes getting used to. In particular, note that each pin on the microbit has its own unique type. The purpose of the degrade() function in initialization is to convert these to a common type that can reasonably be used as an argument to init_channel() and thence to input_pin(). We connect channel0 to button_a and channel1 to button_b. In each case, we set the button up to generate events on a falling edge (hi_to_lo). We store a reference to our GPIOTE peripheral in the GPIO Mutex. We then unmask GPIOTE interrupts, allowing them to be propagated by the hardware, and call unpend to clear any interrupts with pending status (which may have been generated prior to the interrupts being unmasked).

